export default function Home() {
  const [openSection, setOpenSection] = useState<number | null>(
    sidebarData[0]?.id || null
  );
  const [selectedSection, setSelectedSection] = useState<SidebarSection | null>(
    sidebarData[0] || null
  );
  const [selectedImageIndex, setSelectedImageIndex] = useState<number>(0);
  const [zoom, setZoom] = useState(1);

  useEffect(() => {
    if (sidebarData.length > 0) {
      setOpenSection(sidebarData[0].id);
      setSelectedSection(sidebarData[0]);
      setSelectedImageIndex(0);
    }
  }, []);

  const toggleSection = (section: SidebarSection) => {
    setOpenSection(section.id);
    setSelectedSection(section);
    setSelectedImageIndex(0);
    setZoom(1);
  };

  const zoomIn = () => setZoom((prev) => Math.min(prev + 0.2, 3));
  const zoomOut = () => setZoom((prev) => Math.max(prev - 0.2, 1));
  const resetZoom = () => setZoom(1);

  const prevImage = () => {
    if (selectedSection && selectedImageIndex > 0) {
      setSelectedImageIndex((prev) => prev - 1);
      setZoom(1);
    }
  };

  const nextImage = () => {
    if (
      selectedSection &&
      selectedImageIndex < selectedSection.attachments.length - 1
    ) {
      setSelectedImageIndex((prev) => prev + 1);
      setZoom(1);
    }
  };

  const selectedImage =
    selectedSection?.attachments[selectedImageIndex]?.url || "/OIP.jpg";
  const selectedSectionName = selectedSection?.name || "Select an Image";

  return (
    <div className="flex h-screen flex-col">
      <header className="bg-white text-black border-b border-gray-300 fixed top-0 left-0 right-0 z-10 h-16 flex items-center px-4">
        <Image
          className=""
          src="/logo.png"
          alt="PROINSPEC"
          width={180}
          height={38}
          priority
        />
        {/* <div className="text-center flex-1">Print the Addrees Here</div> */}
      </header>

      <div className="flex flex-1 mt-16">
        {/* Sidebar */}
        <aside className="w-120 bg-white  text-black fixed top-16 left-0 h-[calc(100vh-4rem)] overflow-y-auto flex">
          <div className="w-75 bg-gray-100">
            {sidebarData.map((section) => (
              <div
                key={section.id}
                className={` border-b border-gray-300 p-1.5 ${
                  openSection === section.id
                    ? "border-l-4 border-purple-500 bg-white"
                    : ""
                }`}
                onClick={() => toggleSection(section)}
              >
                <p className="cursor-pointer p-1 flex items-center justify-between">
                  <span className="text-sm content-center pl-2">
                    {section.name}
                  </span>
                  <span className="text-xs text-white bg-purple-500 rounded-full px-1.5 py-0.5">
                    {section.attachments.length}
                  </span>
                </p>
              </div>
            ))}
          </div>

          <div className="border-r border-gray-300 h-full"></div>
          <div className="pl-2 mt-1 pr-[7px]">
            {selectedSection && (
              <div>
                {selectedSection.attachments.map((attachment, index) => (
                  <img
                    key={attachment.id}
                    src={attachment.url}
                    alt={attachment.caption}
                    className={`w-full h-34 object-cover rounded mb-2 cursor-pointer ${
                      selectedImageIndex === index
                        ? "border-3 border-purple-500"
                        : ""
                    }`}
                    onClick={() => setSelectedImageIndex(index)}
                  />
                ))}
              </div>
            )}
          </div>
        </aside>

        {/* Main Content */}
        <main className="flex-1 ml-120 p-4 flex justify-center items-center overflow-hidden relative bg-white">
          <div className="absolute p-1 top-3 left-1/2 -translate-x-1/2 flex w-full grid grid-cols-3 gap-1 bg-black/30 rounded-sm z-10 ml-[3px] mr-[2px]">
            <div className="flex gap-1">
              <button
                onClick={zoomIn}
                className="p-1.5 bg-purple-400 text-white rounded hover:bg-purple-500 flex justify-center"
              >
                <Plus size={15} />
              </button>
              <button
                onClick={zoomOut}
                className="p-1.5 bg-purple-400 text-white rounded hover:bg-purple-500 flex justify-center"
              >
                <Minus size={15} />
              </button>
            </div>

            <div className="flex items-center justify-center text-white-900 font-semibold text-sm">
              {selectedSectionName}
            </div>

            <div className="flex justify-end">
              <button
                className="p-1.5 bg-purple-400 text-white rounded hover:bg-purple-500 flex justify-center"
                onClick={() => window.open(selectedImage, "_blank")}
              >
                <Maximize size={15} />
              </button>
            </div>
          </div>

          <div className="w-full h-full max-w-screen-lg flex justify-center items-center">
            <div
              className="relative flex justify-center items-center overflow-auto w-full h-full pointer-events-none"
              style={{ width: "100%", height: "100%" }}
            >
              <img
                src={selectedImage}
                alt="Selected"
                className="w-full h-auto max-h-[87vh] object-contain rounded cursor-pointer transition-transform duration-300"
                style={{ transform: `scale(${zoom})` }}
              />
            </div>

            {selectedSection && selectedSection.attachments.length > 1 && (
              <>
                <button
                  onClick={prevImage}
                  disabled={selectedImageIndex === 0}
                  className="absolute left-4 top-1/2 transform -translate-y-1/2 bg-purple-400 text-white p-2 rounded-full hover:bg-purplee-600 disabled:opacity-50 pointer-events-auto"
                >
                  <ChevronLeft size={24} />
                </button>

                <button
                  onClick={nextImage}
                  disabled={
                    selectedImageIndex ===
                    selectedSection.attachments.length - 1
                  }
                  className="absolute right-4 top-1/2 transform -translate-y-1/2 bg-purple-400 text-white p-2 rounded-full hover:bg-purple-600 disabled:opacity-50 pointer-events-auto"
                >
                  <ChevronRight size={24} />
                </button>
              </>
            )}
          </div>
        </main>
      </div>
    </div>
  );
}
